import React from 'react';
import { MyContext } from "./MyContext";
import Card from "./Card";


/* Contains all user submissions
 - the amount that was submitted and withdrawn? 

 Amount submitted:
 Amount withdrawn:
 Amount left / balance:


*/
function AllData(){
  return (
    <Card
      bgcolor="info"
      header="All Data"
      body={
          <>  
            <h5 className="balance mb-5">All Your Data in one spot!</h5>
            {/* {JSON.stringify(ctx)}<br/> */}
          </>
      }
    />
  );
}


export default AllData;
